import React, { Component } from 'react';
import Main from '../src/components/Main';
import './App.css';


class App extends Component {


  render(){
    return (
      <div className="App">
        <header className="App-header">
          <h1 className="App-title">TV Series List</h1>  
        </header>
        <Main/>
      </div>
    );
  }
}

export default App;
